import { Space } from 'antd';

const Gjournal = () => (

  <div>
  <Space
    direction="vertical"
    size="middle"
    style={{
      display: 'flex',
    }}
  >


    <div  size="small" style={{width:"1000px",marginBlockStart:"200px",margin:"200px",heigth:"100px"}}>
      <p style={{borderBottom:"1px solid grey"}}></p>
      <p style={{borderBottom:"1px solid LightGray"}}>Card content</p>
      <p style={{borderBottom:"1px solid LightGray"}}>Card content</p>
      <p>Card content</p>

    </div>

  </Space>
  </div>
);

export default Gjournal;
